package weekone;

public class Loops {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		int i = 5;
		
		while(i<100) {
			
			i=i+5;
			System.out.println(i);
		}
		
		
		int a = 10;
		
		do {
			a=a+5;
			System.out.println("A is Less Than 50-------"+a);
		}while(a<50);
		
		
		

	}

}
